import { Task } from '../model/model'

const CurrentDoingTaskKey = "CurrentDoingTaskKey"

const currentDoingTaskStore = {
    currentDoingTask: undefined as Task|undefined,

    setCurrentDoingTask(task: Task| undefined) {
        this.currentDoingTask = task
    },
};

export {CurrentDoingTaskKey, currentDoingTaskStore}
